import './App.css';
import LightPillar from './predict.jsx';   // ✅ default import, no curly braces

function App() {
  return (
<div style={{ width: '100%', height: '600px', position: 'relative' }}>
  <LightPillar
    topColor="#29ff7b"
    bottomColor="#9effbb"
    intensity={1}
    rotationSpeed={0.3}
    glowAmount={0.002}
    pillarWidth={3}
    pillarHeight={0.4}
    noiseIntensity={0.5}
    pillarRotation={25}
    interactive={false}
    mixBlendMode="screen"
    quality="high"
/>
</div>
  );
}

export default App;
